<body class=theme--dark>
<div id=app style=height:100%>
<header class=mdc-top-app-bar>
<div class=mdc-top-app-bar__row>
<section class="mdc-top-app-bar__section mdc-top-app-bar__section--align-start">
<button class="material-icons mdc-top-app-bar__navigation-icon mdc-icon-button" disabled>school</button>
<span class=mdc-top-app-bar__title>{{ app.title }}</span>
</section>
<section class="mdc-top-app-bar__section mdc-top-app-bar__section--align-end" role=toolbar>
<a class="mdc-button mdc-button--outlined" href="https://hotdogishot.github.io/PCompiler/" target="_blank">
<span class=mdc-button__ripple></span>
<span class=mdc-drawer__label>Télécharger PCompiler</span>
</a>
<span class=mdc-top-app-bar__action-item ref=days></span>
<small>Days</small>
<span class=mdc-top-app-bar__action-item ref=hours></span>
<small>Hours</small>
<span class=mdc-top-app-bar__action-item ref=minutes></span>
<small>Minutes</small>
<span class=mdc-top-app-bar__action-item ref=seconds></span>
<small>Seconds</small>
</section>
</div>
</header>
<main class=mdc-top-app-bar--fixed-adjust>
<aside class=mdc-drawer>
<div class=mdc-drawer__content>
<nav class=mdc-list>
<template v-for="(item, index) in items">
<div class=toggle v-on:click=toggle($event.currentTarget)>
<a class=mdc-list-item v-bind:class="{ 'mdc-list-item--activated': (index == 0)}">
<span class=mdc-list-item__ripple></span>
<i class="material-icons mdc-list-item__graphic" aria-hidden=true v-html=item.icon></i>
<span class=mdc-list-item__text>{{ item.matiere }}</span>
</a>
<div class=more>
<hr class=mdc-list-divider>
<h6 class=mdc-list-group__subheader>{{ item.matiere }}</h6>
<ul class=mdc-list>
<a class=mdc-list-item role=menuitem v-for="item0 in item.items" v-on:click="browser(item.key, item0.nom)">
<span class=mdc-list-item__ripple></span>
<i class="material-icons mdc-list-item__graphic" aria-hidden=true>picture_as_pdf</i>
<span class=mdc-list-item__text>{{ item0.nom }}</span>
</a>
</ul>
<hr class=mdc-list-divider>
</div>
</div>
</template>
</nav>
</div>
</aside>
<div id=navigator>
<iframe src></iframe>
</div>
</main>
